package asia.lhweb.entity;public class Books {    private Integer bookId;    private String bookName;    private String author;    private String publisher;    public Books() {        super();    }    public void setBookId(Integer bookId) {        this.bookId = bookId;    }    public Integer getBookId() {        return this.bookId;    }    public void setBookName(String bookName) {        this.bookName = bookName;    }    public String getBookName() {        return this.bookName;    }    public void setAuthor(String author) {        this.author = author;    }    public String getAuthor() {        return this.author;    }    public void setPublisher(String publisher) {        this.publisher = publisher;    }    public String getPublisher() {        return this.publisher;    }    @Override    public String toString() {        return "Books{" +                "bookId=" + bookId +                ", bookName='" + bookName + '\'' +                ", author='" + author + '\'' +                ", publisher='" + publisher + '\'' +                '}';    }}